import React, { useState } from 'react'
import NoteList from './NoteList'
import Inputs from './Inputs'







const App = () =>{
    const [add, setArray] = useState([])
    const addNote = (value,e) =>{
        if(value.title === '' && value.note === ''){
            return;
        }
    
            setArray((prevData)=>{
                return [...prevData, value]
                })

    }

    const deletebtn = () =>{
        alert ('clicked')
    }
    
    return(
        <>
        <div className="wrapper">
            <div className="container">
                <Inputs
                createNote = {addNote}
                />
                
                {add.map((val, index) => {
                    return(
                        <NoteList
                    title = {val.title}
                    note = {val.note}
                    key = {index}
                    id = {index}
                    delete = {deletebtn}
                    />
                    ) 
                })}
                
            </div>
        </div>
        </>
    )
}


export default App;
